import React from 'react';
const BookPage = ({image, name, author, description}) => {
  return (
    <div className="books-card">
      <img src={image} alt={name}/>
      <h2>{name}</h2>
      <p>{author}</p>
      <p>{description}</p>
    </div>
  );
};

export default BookPage;
